import React from 'react';

const programAreaOptions = [
  { value: '', label: 'Please Select:' },
  { value: 'Community Integration Service', label: 'Community Integration Service' },
  { value: 'Community Services', label: 'Community Services' },
  { value: 'Operations Support - Analytics and Business Intelligence', label: 'Operations Support - Analytics and Business Intelligence' },
  { value: 'Operations Support - Communications, Engagement and Organizational Health', label: 'Operations Support - Communications, Engagement and Organizational Health' },
  { value: 'Operations Support - Finance, Contracts and Records Management', label: 'Operations Support - Finance, Contracts and Records Management' },
  { value: 'Operations Support - Recruitment, Staffing, Facilities and Assets', label: 'Operations Support - Recruitment, Staffing, Facilities and Assets' },
  { value: 'PLMS - Administrative Team', label: 'PLMS - Administrative Team' },
  { value: 'PLMS - Enforcement', label: 'PLMS - Enforcement' },
  { value: 'PLMS - Operations Management', label: 'PLMS - Operations Management' },
  { value: 'PLMS - Program Integrity and Evaluation', label: 'PLMS - Program Integrity and Evaluation' },
  { value: 'PLMS - Prevention and Compliance', label: 'PLMS - Prevention and Compliance' },
  { value: 'PLMS - Service Quality Team', label: 'PLMS - Service Quality Team' },
  { value: 'PLMS - START', label: 'PLMS - START' },
  { value: 'Strategic Service Branch', label: 'Strategic Service Branch' },
  { value: 'Virtual Service - Contact Centre', label: 'Virtual Service - Contact Centre' },
  { value: 'Virtual Service - Intake', label: 'Virtual Service - Intake' },
  { value: 'Virtual Service - Health and Specialized Services', label: 'Virtual Service - Health and Specialized Services' },
  { value: 'Not Applicable', label: 'Not Applicable' }
];

const ProgramAreaDropdown = ({ id, name, value, onChange }) => {
  return (
    <div>
      <label htmlFor={id}>Branch/Program Area:</label>
      <select id={id} name={name} value={value} onChange={onChange}>
        {programAreaOptions.map((option) => (
          <option key={option.value || 'default'} value={option.value}>
            {option.label}
          </option>
        ))}
      </select>
    </div>
  );
};

export default ProgramAreaDropdown;
